INSERT INTO `frontend_settings` (`id`, `key`, `value`) VALUES
(1, 'banner_title', 'Study anywhere, anytime'),
(2, 'banner_sub_title', 'As long as you have internet and needs, to learn!'),
(4, 'about_us', '<p></p><h2><span xss=\"removed\">This is about us</span></h2><p><span xss=\"removed\">Welcome to Online Schlool. </span></p><p><span xss=\"removed\">They are products that connect with the most knowledgeable moment and students who want to learn, empower themselves.</span></p><p><span xss=\"removed\">Dongdok Village, Xaythany District, Vientiane Capital</span></p><p><span xss=\"removed\">Phone +856 02091826096</span></p><p>Email nousainther@gmail.com</p><p> <a href=\"https://www.facebook.com/nousua.sainther\" target=\"_blank\" xss=removed>Facebook</a> <a href=\"https://www.facebook.com/nousua.sainther\" target=\"_blank\" xss=removed>Whatapp</a> <a href=\"https://www.facebook.com/nousua.sainther\" target=\"_blank\" xss=removed>Youtube</a></p><p><br><br></p>'),
(10, 'terms_and_condition', '<h2>Terms and Condition</h2><h3><span xss=\"removed\">At present, we have a policy to use the system as follows:</span></h3><h4><h5><ol><li><span xss=\"removed\">After the registration is complete, have everyone fill in your personal information in the settings menu in your Dashboard as an important contact information in the transfer.</span></li><li><span xss=\"removed\">The system will allow anyone who wants to learn to register as a student or teacher, then the system will be approved to be able to attend and use the system.</span></li><li><span xss=\"removed\">Students who have completed a fee-based course can contact our company by phone to request a certificate of completion of the course. We have a review so that students can achieve our expectations and can then issue a certificate of completion of the course.</span></li><li><span xss=\"removed\">Teachers who create courses in the system will receive a policy of 90% of the total income they earn (until 31/12/2021, then the company will periodically review the policy) with a request to withdraw in their account as needed, but the remaining 50 million. 10% will be deducted by the company to maintain and develop the system to be more modern step by step.</span></li><li><span xss=\"removed\">Teachers must publish socially useful lessons, videos or lessons that are obscene, teachers who violate political policies, rules and regulations will not be published and will not be able to block content from being released to society.</span></li></ol></h5></h4>'),
(11, 'privacy_policy', '<p></p><p></p><h2><span xss=\"removed\">Privacy Policy</span><br></h2><div><br></div><h5><span xss=removed>Requirements for using the system must be someone who has a valid email, phone number and other personal information that is truly identical:<br></span><span xss=removed>1. You can register for the course as a free course, free of charge, just click on the order of all forms with a fee of 0 LAK, then we will open the system for you to use.<br></span><span xss=removed>2. You can order courses with cost by transferring course fees through the account or One Pay that we have set and notify in writing to the Admin number on 02091826096 and we will check the details of your transfer and will be open to the course you have ordered.<br></span><span xss=removed>3. After you have agreed to purchase a paid course, we will not consider transferring money back in case you do not want to take the course you have already agreed to purchase.</span></h5>'),
(13, 'theme', 'default'),
(14, 'cookie_note', 'This website uses cookies to personalize content and analyse traffic in order to offer you a better experience.'),
(15, 'cookie_status', 'active'),
(16, 'cookie_policy', '<h1>Cookie policy</h1><ol><li>Cookies are small text files that can be used by websites to make a user\'s experience more efficient.</li><li>The law states that we can store cookies on your device if they are strictly necessary for the operation of this site. For all other types of cookies we need your permission.</li><li>This site uses different types of cookies. Some cookies are placed by third party services that appear on our pages.</li></ol>'),
